sealed trait SetsList {
  def key: String
  def firstStart: Int
  def secondStart: Int
  def count(i1: Int, i2: Int): Option[Int]
}
case class CommonSetsList(override val key: String, override val firstStart: Int, override val secondStart: Int, value: (Int, Int) => Int) extends SetsList {
  override def count(i1: Int, i2: Int): Option[Int] = Option(value(i1, i2))
}
case class OptSetsList(
  override val key: String,
  override val firstStart: Int,
  override val secondStart: Int,
  value: (Int, Int) => Option[Int]
) extends SetsList {
  override def count(i1: Int, i2: Int): Option[Int] = value(i1, i2)
}
trait MapParameterSetsList extends SetsList {
  def mapParameter(i1: Int, i2: Int): (Int, Int)
  def countWithSetList(setList: SetsList, i1: Int, i2: Int): Option[Int] = {
    val (v1, v2) = mapParameter(i1, i2)
    setList.count(v1, v2)
  }
  def linkKey: String
}
trait MapResultSetsList extends SetsList {
  def mapResult(i1: Option[Int]): Option[Int]
  def countWithSetList(setList: SetsList, i1: Int, i2: Int): Option[Int] = mapResult(setList.count(i1, i2))
  def linkKey: String
}

trait SetsColAbs {
  def setsCol: Vector[SetsList]            = setsList
  protected var setsList: Vector[SetsList] = Vector.empty

  def getSet(key: String): SetsList = setsList.find(s => s.key == key).get

  case class FirstStart(key: String, firstStart: Int)
  case class SecondStart(key: String, firstStart: Int, secondStart: Int)

  protected implicit class extract1(second: SecondStart) {
    def value(v: (Int, Int) => Int): Unit = setsList = setsList.appended(CommonSetsList(key = second.key, firstStart = second.firstStart, secondStart = second.secondStart, value = v))
  }
  protected implicit class extract2(second: SecondStart) {
    def value(v: (Int, Int) => Option[Int]): Unit = setsList = setsList.appended(OptSetsList(key = second.key, firstStart = second.firstStart, secondStart = second.secondStart, value = v))
  }
  protected implicit class extract5(second: SecondStart) {
    def value(linkKey1: String, v: (Int, Int) => (Int, Int)): Unit = setsList = setsList.appended(new MapParameterSetsList {
      override def mapParameter(i1: Int, i2: Int): (Int, Int) = v(i1, i2)
      override def linkKey: String                            = linkKey1
      override def key: String                                = second.key
      override def firstStart: Int                            = second.firstStart
      override def secondStart: Int                           = second.secondStart
      override def count(i1: Int, i2: Int): Option[Int]       = countWithSetList(getSet(linkKey1), i1, i2)
    })
  }
  protected implicit class extract6(second: SecondStart) {
    def mapResult(linkKey1: String, v: Option[Int] => Option[Int]): Unit = setsList = setsList.appended(new MapResultSetsList { self =>
      override def mapResult(i1: Option[Int]): Option[Int] = v(i1)
      override def linkKey: String                         = linkKey1
      override def key: String                             = second.key
      override def firstStart: Int                         = second.firstStart
      override def secondStart: Int                        = second.secondStart
      override def count(i1: Int, i2: Int): Option[Int]    = countWithSetList(getSet(linkKey1), i1, i2)
    })
  }
  protected implicit class extract3(key: String) {
    def firstart(f: Int): FirstStart = FirstStart(key = key, firstStart = f)
  }
  protected implicit class extract4(firstStart: FirstStart) {
    def secondStart(s: Int): SecondStart = SecondStart(key = firstStart.key, firstStart = firstStart.firstStart, secondStart = s)
  }
}

